import React from "react";
import { Component } from "react";
import Header from './Header';

import '../resources/css/bootstrap.css';
import blog from '../resources/images/blog.jpg';
import diary from '../resources/images/diary.jpg';
import computer from '../resources/images/computer.jpg';
import web_design from '../resources/images/web-design.jpg';


export default class Home extends Component {
    render() {
        return (
            <>
                <div>
                    <Header />
                    <div className="container mt-5">
                        <div class="row justify-content-center">
                            <div id="carousel" className="carousel slide" data-bs-ride="carousel">
                                <div className="carousel-inner">
                                    <div className="carousel-item active w-75" data-bs-interval="3000">
                                        <img className="d-block img-fluid" src={blog} alt="First slide"  />
                                    </div>

                                    <div className="carousel-item w-75" data-bs-interval="3000">
                                        <img className="d-block img-fluid" src={diary} alt="Second slide" height="400" />
                                    </div>

                                    <div className="carousel-item w-75" data-bs-interval="3000">
                                        <img className="d-block img-fluid" src={computer} alt="Third slide" height="400" />
                                    </div>

                                    <div className="carousel-item w-75" data-bs-interval="3000">
                                        <img className="d-block img-fluid" src={web_design} alt="Fourth slide" height="400" />
                                    </div>

                                </div>

                            </div>
                        </div>
                    </div>
                </div>
            </>
        )
    }

}
